fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypotonia_cystinuria_syndrome rdfs:subClassOf [ owl:intersectionOf [ rdf:first [ a owl:Restriction ;
                            owl:onProperty :has_material_basis_in ;
                            owl:someValuesFrom :deletion ] ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_material_basis_in ;
                                    owl:someValuesFrom :chromosome ] ;
                            rdf:rest :nil ] ] ],
        :chromosomal_deletion_syndrome,
        :syndrome ;
    :has_definition "A syndrome that has_material_basis_in homozygous deletion on chromosome 2p21 that disrupts the SLC3A1 and PREPL genes. The deletion ranges in size from 23.8 to 75.5 kb. Itis characterized_by neonatal and infantile hypotonia and failure to thrive, cystinuria type 1 and nephrolithiasis, growth retardation due to growth hormone deficiency, and minor facial dysmorphism." ;
    :has_exact_synonym "cystinuria with mitochondrial disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:salmonellosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :diarrhea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_cramp ],
        :primary_bacterial_infectious_disease ;
    :has_definition "A primary bacterial infectious disease caused by the bacteria of the genus Salmonella. It has symptoms diarrhea, fever, vomiting, and abdominal cramps 12 to 72 hours after infection. In most cases, the illness lasts four to seven days, and most people recover without treatment." ;
    :has_exact_synonym "Salmonella infection"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:microphthalmia_with_limb_anomalies rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by autosomal recessive inheritance of bilateral or unilateral clinical anophthalmia or microphthalmia and synostosis, syndactyly, oligodactyly and/or polydactyly that has_material_basis_in homozygous mutation in the SMOC1 gene on chromosome 14q24." ;
    :has_exact_synonym "MLA"@en,
        "OAS"@en,
        "Waardenburg anophthalmia syndrome"@en,
        "anophthalmia-syndactyly syndrome"@en,
        "ophthalmoacromelic syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mal_de_meleda rdfs:subClassOf :palmoplantar_keratosis ;
    :has_definition "A palmoplantar keratosis characterized by autosomal recessive inheritance of symmetric palmoplantar hyperkeratosis that progressively extends to the dorsal surfaces of hands and feet and ichthyotic changes elsewhere that has_material_basis_in homozygous mutation in the SLURP1 gene on chromosome 8q24." ;
    :has_exact_synonym "Meleda disease"@en,
        "keratosis palmoplantaris transgrediens of Siemens"@en,
        "transgrediens palmoplantar keratoderma of Siemens"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:patterned_macular_dystrophy rdfs:subClassOf :macular_degeneration ;
    :has_definition "A macular degeneration characterized by abnormal accumulation of lipofuscin in the retinal pigment epithelium in a distinct pattern, patterns include; reticular ('fishnet-like'), macroreticular ('spider-shaped'), and butterfly-shaped." ;
    :has_exact_synonym "patterned dystrophy of retinal pigment epithelium"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:patterned_macular_dystrophy_2 rdfs:subClassOf :patterned_macular_dystrophy ;
    :has_definition "A patterned macular dystrophy characterized by bilateral accumulation of pigmented or yellowish material at the level of the retinal pigment epithelium in lesions that resemble the wings of a butterfly that has_material_basis_in heterozygous mutation in the CTNNA1 gene on chromosome 5q31." ;
    :has_exact_synonym "MDPT2"@en,
        "butterfly-shaped pigmentary maculary dystrophy 2"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:patterned_macular_dystrophy_3 rdfs:subClassOf :patterned_macular_dystrophy ;
    :has_definition "A patterned macular dystrophy characterized by a 'dry desert land' pattern of the fundus, involving the posterior pole initially and progressing from the temporal fovea to the periphery of the retina developing in the fourth or fifth decade of life that has_material_basis_in heterozygous mutation in the MAPKAPK3 gene on chromosome 3p21." ;
    :has_exact_synonym "MDPT3"@en,
        "Martinique crinkled retinal pigment epitheliopathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:patterned_macular_dystrophy_1 rdfs:subClassOf :patterned_macular_dystrophy ;
    :has_definition "A patterned macular dystrophy characterized by bilateral accumulation of pigmented or yellowish material at the level of the retinal pigment epithelium in lesions that resemble the wings of a butterfly that has_material_basis_in heterozygous mutation in the PRPH2 gene on chromosome 6p21." ;
    :has_exact_synonym "MDPT1"@en,
        "butterfly-shaped pigmentary maculary dystrophy 1"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:macrocephaly_autism_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :frontal_bossing ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :long_philtrum ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :macrocephaly ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :midface_retrusion ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :square_face ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by macrocephaly, facial phenotypes including square outline with frontal bossing, 'dished-out' midface, biparietal narrowing, and long philtrum, developmental delay and autism that has_material_basis_in heterozygous mutation in the PTEN gene on chromosome 10q23." ;
    :has_exact_synonym "macrocephaly-intellectual disability-autism syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:leukoencephalopathy_with_vanishing_white_matter rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :leukodystrophy ;
    :has_definition "A leukodystrophy characterized by variable neurologic features resulting from deficiency in astrocyte maturation, including progressive cerebellar ataxia, spasticity, and cognitive impairment associated with white matter lesions on brain imaging with onset from early infancy to adulthood." ;
    :has_exact_synonym "CACH/VWM",
        "CACH"@en,
        "childhood ataxia with central nervous system hypomyelination"@en,
        "vanishing white matter leukodystrophy"@en ;
    :has_narrower_match "ORDO:157713",
        "ORDO:157716",
        "ORDO:157719" ;
    :has_related_match "ORDO:99853" ;
    :has_related_synonym "ovarioleukodystrophy" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:late_onset_retinal_degeneration rdfs:subClassOf :retinal_degeneration ;
    :has_definition "A retinal degeneration characterized by autosomal dominant inheritance of night blindness and drusen deposits, progressing to severe central and peripheral degeneration, with choroidal neovascularization and chorioretinal atrophy with onset in the fifth to sixth decade of life that has_material_basis_in heterozygous mutation in the C1QTNF5 gene on chromosome 11q23." ;
    :has_exact_synonym "LORD"@en,
        "autosomal dominant late-onset retinal degeneration"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:isolated_growth_hormone_deficiency rdfs:subClassOf :hypopituitarism ;
    :has_definition "A hypopituitarism characterized by abnormally low levels, absence or impaired function of growth hormone in the absence of abnormalities in other pituitary hormones." ;
    :has_exact_synonym "IGHD"@en,
        "congenital IGHD"@en,
        "congenital isolated GH deficiency"@en,
        "congenital isolated growth hormone deficiency"@en,
        "familial isolated growth hormone deficiency"@en,
        "non-acquired isolated growth hormone deficiency"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:autosomal_dominant_keratitis_ichthyosis_deafness_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome characterized by congenital deafness, keratopachydermia and constrictions of fingers and toes that has_material_basis_in heterozygous mutation in the GJB2 gene on chromosome 13q." ;
    :has_exact_synonym "autosomal dominant KID syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:isolated_growth_hormone_deficiency_type_ii rdfs:subClassOf :isolated_growth_hormone_deficiency ;
    :has_definition "An isolated growth hormone deficiency characterized by autosomal dominant inheritance of low but detectable levels of GH1 resulting in variable degrees of dwarfism which are responsive to growth hormone therapy that has_material_basis_in dominant negative mutations in the GH1 gene on chromosome 17q23.3." ;
    :has_exact_synonym "IGHD II"@en,
        "autosomal dominant isolated growth hormone deficiency"@en,
        "autosomal dominant pituitary dwarfism due to isolated growth hormone deficiency"@en,
        "congenital IGHD type II"@en,
        "congenital isolated GH deficiency type II"@en,
        "congenital isolated growth hormone deficiency type II"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:isolated_growth_hormone_deficiency_type_ia rdfs:subClassOf :isolated_growth_hormone_deficiency ;
    :has_definition "An isolated growth hormone deficiency characterized by autosomal recessive inheritance of severe dwarfism with onset by 6 months of age and variable development of antibodies to growth hormone following exogenous supplementation that has_material_basis_in null mutations in the GH1 gene on chromosome 17q23.3." ;
    :has_exact_synonym "IGHD IA"@en,
        "Illig-type growth hormone deficiency"@en,
        "autosomal recessive isolated growth hormone deficiency"@en,
        "pituitary dwarfism I"@en,
        "primordial dwarfism"@en,
        "sexual ateleiotic dwarfism"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:isolated_growth_hormone_deficiency_type_ib rdfs:subClassOf :isolated_growth_hormone_deficiency ;
    :has_definition "An isolated growth hormone deficiency characterized by autosomal recessive inheritance of low but detectable levels of GH, short stature, significantly retarded bone age, and a positive response and immunologic tolerance to growth hormone therapy that has_material_basis_in mutation in the GH1 or GHRHR genes on chromosomes 17q23.3 and 7p14.3, respectively." ;
    :has_exact_match "OMIM:618157" ;
    :has_exact_synonym "IGHD IB"@en,
        "congenital IGHD type IB"@en,
        "congenital isolated GH deficiency type IB"@en,
        "congenital isolated growth hormone deficiency type IB"@en,
        "dwarfism of Sindh"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:isolated_growth_hormone_deficiency_type_iii rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :x_linked_recessive_inheritance ],
        :isolated_growth_hormone_deficiency,
        :x_linked_recessive_disease ;
    :has_definition "An isolated growth hormone deficiency characterized by dwarfism, variable occurence of hypogammaglobulinemia, and a generally good response to growth hormone therapy that has_material_basis_in mutation in the BTK gene on chromosome Xq22.1." ;
    :has_exact_synonym "Fleisher syndrome"@en,
        "IGHD III"@en,
        "X-linked IGHD"@en,
        "X-linked agammaglobulinemia and isolated growth hormone deficiency"@en,
        "X-linked hypogammaglobulinemia and isolated growth hormone deficiency"@en,
        "X-linked isolated growth hormone deficiency"@en,
        "congenital IGHD type III"@en,
        "congenital isolated GH deficiency type III"@en,
        "congenital isolated growth hormone deficiency type III"@en,
        "growth hormone deficiency with hypogammaglobulinemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:bullous_congenital_ichthyosiform_erythroderma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :ichthyosis ;
    :has_definition "An ichthyosis characterized by congenital erythema and widespread skin blistering, blisters develop into gray hyperkeratoses with a lichenified appearance, and that has_material_basis_in heterozygous mutation in the KRT2 gene on chromosome 12q13." ;
    :has_exact_synonym "bullous type ichthyosis"@en,
        "ichthyosis bullosa of Siemens"@en,
        "superficial epidermolytic ichthyosis"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypoparathyroidism_deafness_renal_disease_syndrome rdfs:subClassOf :chromosomal_deletion_syndrome ;
    :has_definition "A chromosomal deletion syndrome that is characterized by autosomal dominant inheritance of hypoparathyroidism, sensorineural deafness and progressive renal failure and that has_material_basis_in chromosome deletion that results in haploinsufficiency of the GATA3 gene on chromosome 10p14." ;
    :has_exact_synonym "Barakat syndrome"@en,
        "HDR syndrome"@en,
        "hypoparathyroidism, sensorineural deafness, and renal disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:primary_hypomagnesemia rdfs:subClassOf :metal_metabolism_disorder ;
    :has_definition "A metal metabolism disorder characterized by very low serum magnesium levels often with secondary hypocalcemia with onset typically in the first months of life." ;
    :has_exact_synonym "HOMG"@en,
        "primary familial hypomagnesemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_hypomagnesemia_3 rdfs:subClassOf :primary_hypomagnesemia ;
    :has_definition "A hypomagnesemia characterized by autosomal recessive inheritance of excessive urinary Ca(2+) and Mg(2+) excretion that has_material_basis_in homozygous or compound heterozygous mutation in the CLDN16 gene on chromosome 3q28." ;
    :has_exact_synonym "FHHNC without severe ocular involvement"@en,
        "HOMG3"@en,
        "familial primary hypomagnesemia with hypercalciuria and nephrocalcinosis without severe ocular involvement"@en,
        "isolated renal hypomagnesemia"@en,
        "primary hypomagnesemia due to defect in renal tubular transport of magnesium"@en,
        "renal hypomagnesemia type 3"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_hypomagnesemia_5_with_ocular_involvement rdfs:subClassOf :primary_hypomagnesemia ;
    :has_definition "A hypomagnesemia characterized by autosomal recessive inheritance of renal magnesium wasting with hypercalcinosis, progressive renal failure and severe ocular involvement that has_material_basis_in homozygous mutation in the CLDN19 gene on chromosome 1p34.2." ;
    :has_exact_synonym "FHHNC with severe ocular involvement"@en,
        "Meier-Blumberg-Imahorn syndrome"@en,
        "bilateral macular coloboma with hypercalciuria"@en,
        "familial hypomagnesemia with hypercalciuria, nephrocalcinosis and severe ocular involvement"@en,
        "hypercalciuria-bilateral macular coloboma syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_hypomagnesemia_4 rdfs:subClassOf :primary_hypomagnesemia ;
    :has_definition "A hypomagnesemia characterized by isolated hypomagnesemia due to renal loss with normal serum calcium levels and urinary calcium excretion that has_material_basis_in variation in the chromosome region 4q25." ;
    :has_exact_synonym "HOMG4"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intestinal_hypomagnesemia_1 rdfs:subClassOf :primary_hypomagnesemia ;
    :has_definition "A hypomagnesemia characterized by very low serum magnesium levels due to defects in intestinal absorption and kidney excretion and secondary hypocalcemia that has_material_basis_in homozygous or compound heterozygous mutations in the TRPM6 gene on chromosome 9q21." ;
    :has_exact_synonym "HOMG1"@en,
        "hypomagnesemia caused by selective magnesium malabsorption"@en,
        "hypomagnesemia intestinal type 1"@en,
        "hypomagnesemic tetany"@en,
        "intestinal hypomagnesemia with secondary hypocalcemia"@en,
        "primary hypomagnesemia with secondary hypocalcemia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_hypomagnesemia_6 rdfs:subClassOf :primary_hypomagnesemia ;
    :has_definition "A hypomagnesemia characterized by autosomal dominant inheritance of severely lowered serum magnesium levels without other electrolyte disturbances or abnormalities in urinary magnesium excretion that has_material_basis_in heterozygous mutation in the CNNM2 gene on chromosome 10q24." ;
    :has_exact_synonym "HOMG6"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_hypomagnesemia_2 rdfs:subClassOf :primary_hypomagnesemia ;
    :has_definition "A hypomagnesemia characterized by autosomal dominant inheritance of hypomagnesemia due to renal magnesium loss that has_material_basis_in heterozygous mutation in the FXYD2 gene on chromosome 11q23." ;
    :has_exact_synonym "HOMG2"@en,
        "autosomal dominant primary hypomagnesemia with hypocalciuria"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:osteopathia_striata_with_cranial_sclerosis rdfs:subClassOf :osteosclerosis ;
    :has_definition "An osteosclerosis characterized by longitudinal striations of the metaphyses of the long bones, sclerosis of the craniofacial bones, macrocephaly, cleft palate and hearing loss in females and fetal or neonatal lethality in males that has_material_basis_in mutation in the AMER1 gene on chromosome Xq11." ;
    :has_exact_synonym "Robinow-Unger syndrome"@en,
        "hyperostosis generalisata with striations"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ossification_of_the_posterior_longitudinal_ligament_of_spine rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :ligament_of_vertebral_column ],
        :connective_tissue_disease ;
    :has_definition "A connective tissue disease characterized by ectopic ossification of the posterior longitudinal spinal ligament resulting in spinal cord compression, myelopathy and hyperreflexia." ;
    :has_exact_synonym "OPLL"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:transient_myeloproliferative_syndrome rdfs:subClassOf :myeloproliferative_neoplasm ;
    :has_definition "A myeloproliferative neoplasm characterized by leukocytosis in newborns with Down syndrome." ;
    :has_exact_synonym "MST"@en,
        "TAM"@en,
        "transient abnormal myelopoiesis"@en,
        "transient leukemia"@en,
        "transient leukemia of Down syndrome"@en,
        "transient myeloproliferative disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prune_belly_syndrome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome that is characterized by megacystis with disorganized detrusor muscle, cryptorchidism, and thin abdominal musculature with overlying lax skin and that has_material_basis_in homozygous mutation in the CHRM3 gene on chromosome 1q43." ;
    :has_exact_synonym "Eagle-Barret syndrome"@en,
        "Obrisnksy syndrome"@en,
        "abdominal muscle deficiency syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ectopic_cushing_syndrome rdfs:subClassOf :primary_hyperaldosteronism ;
    :has_definition "A primary hyperaldosteronism that is characterized by a tumor outside the pituitary gland produces a hormone called adrenocorticotropic hormone." ;
    :has_exact_synonym "Cushing syndrome due to ectopic ACTH secretion"@en,
        "ectopic ACTH secreting tumor"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parkinson_s_disease_19a rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :early_onset_parkinson_s_disease ;
    :has_definition "An early-onset Parkinson's diseas that has_material_basis_in homozygous mutation in the DNAJC6 gene on chromosome 1p31." ;
    :has_exact_synonym "juvenile onset Parkinson disease 19A"@en,
        "juvenile onset Parkinson's disease 19A"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:late_onset_parkinson_s_disease rdfs:subClassOf :parkinson_s_disease ;
    :has_definition "A Parkinson's disease characterized by onset of motor symptoms typically after 60 years of age." ;
    :has_exact_synonym "late onset Parkinson disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:juvenile_onset_parkinson_s_disease rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :young_adult_onset ],
        :early_onset_parkinson_s_disease ;
    :has_definition "An early-onset Parkinson's disease that is characterized by onset of motor symptoms prior to 21 years of age." ;
    :has_exact_synonym "juvenile-onset Parkinson disease"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:early_onset_parkinson_s_disease rdfs:subClassOf :parkinson_s_disease ;
    :has_definition "A Parkinson's disease characterized by onset of motor symptoms earlier than typically seen, usually prior to 50 years of age." ;
    :has_exact_synonym "early-onset Parkinson disease"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parkinson_s_disease_4 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :late_onset_parkinson_s_disease ;
    :has_definition "A late onset Parkinson disease that has_material_basis_in heterozygous triplication of the alpha-synuclein gene on chromosome 4q22." ;
    :has_exact_synonym "autosomal dominant Lewy body Parkinson disease 4"@en,
        "autosomal dominant Parkinson disease 4"@en,
        "autosomal dominant Parkinson's disease 4"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parkinson_s_disease_23 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :early_onset_parkinson_s_disease ;
    :has_definition "An early-onset Parkinson disease that has_material_basis_in homozygous or compound heterozygous mutation in the VPS13C gene on chromosome 15q22." ;
    :has_exact_synonym "autosomal recessive early-onset Parkinson disease 23"@en,
        "autosomal recessive early-onset Parkinson's disease 23"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parkinson_s_disease_17 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :late_onset_parkinson_s_disease ;
    :has_definition "A late-onset Parkinson disease that has_material_basis_in heterozygous mutation in the VPS35 gene on chromosome 16q13." ;
    :has_exact_synonym "Parkinson disease 17"@en,
        "autosomal dominant Parkinson disease 17"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:parkinson_s_disease_20 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :early_onset_parkinson_s_disease ;
