    :has_definition "A multiple epiphyseal dysplasia due to collagen 9 anomaly that has_material_basis_in heterozygous mutation in the COL9A1 gene on chromosome 6p13." ;
    :has_exact_synonym "EDM6"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_epiphyseal_dysplasia_7 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :multiple_epiphyseal_dysplasia ;
    :has_definition "A multiple epiphyseal dysplasia that has_material_basis_in homozygous mutation in the CANT1 gene on chromosome 17q25." ;
    :has_exact_synonym "EDM7"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_epiphyseal_dysplasia_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :multiple_epiphyseal_dysplasia ;
    :has_definition "A multiple epiphyseal dysplasia that has_material_basis_in heterozygous mutation in the COMP gene on chromosome 19p13." ;
    :has_exact_synonym "EDM1"@en,
        "MED1"@en,
        "multiple epiphyseal dysplasia COMP-related"@en,
        "polyepiphyseal dysplasia type 1"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_epiphyseal_dysplasia_3 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :multiple_epiphyseal_dysplasia_due_to_collagen_9_anomaly ;
    :has_definition "A multiple epiphyseal dysplasia due to collagen 9 anomaly that has_material_basis_in heterozygous mutation in the COL9A3 gene on chromosome 20q13." ;
    :has_exact_synonym "EDM3"@en,
        "multiple epiphyseal dysplasia 3 with or without myopathy"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_epiphyseal_dysplasia_due_to_collagen_9_anomaly rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_basis_in ;
            owl:someValuesFrom :gene ],
        :monogenic_disease,
        :multiple_epiphyseal_dysplasia ;
    :has_definition "A multiple epiphyseal dysplasia that has_material_basis_in mutation in any of the members of the COL9A gene family (COL9A1, COL9A2, COL9A3)." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:post_cardiac_arrest_syndrome rdfs:subClassOf :syndrome ;
    :has_definition "A syndrome that is characterized by four main components: post-cardiac arrest brain injury, post-cardiac arrest myocardial dysfunction, systemic ischemia reperfusion response, and persistent precipitating pathologies." ;
    :has_exact_synonym "post cardiac syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:craniolenticulosutural_dysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :syndrome ;
    :has_definition "A syndrome in neonates that is characterized by facial dysmorphism, late-closing fontanels, cataract, and skeletal defects. It has_material_basis_in the mutation of the SEC23A gene on the 14th chromosome, with the underproduction in the collagen secreting pathway and distension of endoplasmic reticulum leading to bone defects." ;
    :has_exact_synonym "Boyadjiev-Jabs Syndrome"@en,
        "cranio-lenticulo-sutural dysplasia, CLSD"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:rippling_muscle_disease_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_pain ],
        :muscle_tissue_disease ;
    :has_definition "A muscle tissue disease characterized by electrically silent contractions of the skeletal muscles in response to mechanical stimuli. It has_material_basis_in mutation in the gene localized to 1q41 at the distal end of the long arm of chromosome 1, has_symptom characteristic lateral rolling movement of muscle, has_symptom muscle cramps, has_symptom muscle pain, has_symptom muscle stiffness during or following exercise." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:absence_epilepsy rdfs:subClassOf :electroclinical_syndrome ;
    :has_definition "An electroclinical syndrome characterized by the occurrence of generalized onset seizures that cause lapses in awareness, begin and end abruptly, typically last only a few seconds and are associated with abnormal spike-wave discharges as seen by electroencephalogram." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:drug_induced_hearing_loss rdfs:subClassOf :nonsyndromic_deafness ;
    :has_definition "A nonsyndromic deafness that is characterized by cochlear or vestibular dysfunction resulting in loss of hearing caused by drug ototoxicity." ;
    :has_exact_synonym "drug induced hearing loss"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:oligoasthenoteratozoospermia rdfs:subClassOf :male_infertility ;
    :has_definition "A form of male infertility that is characterized by a combination of low number or oligozoospermia, poor motility or asthenozoospermia, and abnormal shape or teratozoospermia of sperms. OAT is the most common cause of male subfertility." ;
    :has_exact_synonym "OAT"@en,
        "oligoasthenoteratospermia"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thiamine_deficiency_disease rdfs:subClassOf :nutritional_deficiency_disease ;
    :has_definition "A nutritional deficiency disease that is characterized by low levels of thiamine." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:obstructive_nephropathy rdfs:subClassOf :kidney_disease ;
    :has_definition "A kidney disease characterized by kidney damage and dysfunction resulting from urinary tract obstruction." ;
    :has_exact_synonym "CON"@en,
        "congenital obstructive nephropathy"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:hypoplastic_right_heart_syndrome rdfs:subClassOf :congenital_heart_disease ;
    :has_definition "A congenital heart disease characterized by underdevelopment of the structures on the right side of the heart commonly associated with atrial septal defect." ;
    :has_exact_synonym "Right hypoplastic heart syndrome" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:miura_type_epiphyseal_chondrodysplasia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :bone_development_disease ;
    :has_definition "A bone developmental disease characterized by tall stature, scoliosis and macrodactyly of the great toes that has_material_basis_in heterozygous mutation in the NPR2 gene on chromosome 9p13." ;
    :has_exact_synonym "ECDM"@en,
        "tall stature-scoliosis-macrodactyly of the great toes syndrome"@en,
        "tall stature-scoliosis-macrodactyly of the halluces syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:wet_beriberi rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dyspnea ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :tachycardia ],
        :beriberi ;
    :has_definition "A beriberi that is located_in the cardiovascular system and has_symptom increased heart rate, swelling of lower legs, and shortness of breath." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:dry_beriberi rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abnormality_of_gait ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :vomiting ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :confusion ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :dysarthria ],
        :beriberi ;
    :has_definition "A beriberi that is located_in the nervous system and has_symptom difficulty walking, numbness in extremities, tingling in extremities, paralysis of lower legs, difficulty speaking, confusion, and vomiting." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:miliaria_pustulosa rdfs:subClassOf :miliaria ;
    :has_definition "A miliaria that is characterized by pustules resulting from inflammation and bacterial infection." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:miliaria_profunda rdfs:subClassOf :miliaria ;
    :has_definition "A miliaria that is characterized by ductal occlusion of the papillary dermis causing the gland's secretions to leak between the superficial and deep layers of the skin resulting in a rapidly-spreading flesh-colored rash." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:miliaria_crystallina rdfs:subClassOf :miliaria ;
    :has_definition "A miliaria that is characterized by clear, superficial, noninflammed, subcorneal vesicles that easily rupture when rubbed and is located_in the stratum corneum." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_hepatocellular_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :hepatocellular_carcinoma ;
    :has_definition "A hepatocellular carcinoma that occurs in children and is characterized by a distinct etiological predisposition, biological behavior, and lower frequency of cirrhosis as compared to adult hepatocellular carcinoma." ;
    :has_exact_synonym "pediatric hepatocellular carcinoma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:childhood_acute_myeloid_leukemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_leukemia ;
    :has_definition "A childhood leukemia that is characterized by the rapid growth of abnormal white blood cells that accumulate in the bone marrow and interfere with the production of normal blood cells." ;
    :has_exact_synonym "childhood acute myeloid leukaemia"@en,
        "paediatric acute myeloid leukaemia"@en,
        "pediatric acute myeloid leukemia"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:systemic_epstein_barr_virus_positive_t_cell_lymphoma_of_childhood rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :childhood_lymphoma ;
    :has_definition "A childhood lymphoma that is characterized by monoclonal expansion of Epstein-Barr virus-positive T cells with an activated cytotoxic phenotype in tissues or peripheral blood." ;
    :has_exact_synonym "EBV-positive T-cell lymphoproliferative disorder of childhood"@en,
        "systemic EBV-positive T-cell lymphoma of childhood"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:malignant_childhood_adrenal_gland_pheochromocytoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :childhood_onset ],
        :adrenal_gland_pheochromocytoma ;
    :has_definition "An adrenal gland pheochromocytoma that is characterized by rare chromaffin cell tumors which secrete catecholamines, and has a higher prevalence of hereditary factors and metastatis in children than adults." ;
    :has_exact_synonym "malignant pediatric adrenal gland pheochromocytoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spitzoid_melanoma rdfs:subClassOf :skin_melanoma ;
    :has_definition "A skin melanoma that is characterized by asymmetric shape, diameter greater than 1 cm, a lesion with a deep invasive component, and a high degree of cytologic atypia." ;
    :has_exact_synonym "atypical spitz nevus"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:melanoma_in_congenital_melanocytic_nevus rdfs:subClassOf :skin_melanoma ;
    :has_definition "A skin melanoma that arises from a congenital melanocytic nevus." ;
    :has_exact_synonym "Malignant melanoma in congenital melanocytic nevus"@en,
        "melanocytic nevi"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_hepatocellular_carcinoma rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abdominal_mass ],
        [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :liver_inflammation ],
        :hepatocellular_carcinoma ;
    :has_definition "A hepatocellular carcinoma that is characterized by hepatic mass, abdominal pain and, in advanced stages, jaundice, cachexia and liver failure and often develops in the setting of chronic necro-inflammation." ;
    :has_exact_synonym "adult hepatoma"@en,
        "adult primary hepatocellular carcinoma"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome rdfs:subClassOf :mitochondrial_metabolism_disease ;
    :has_definition "A mitochondrial metabolism disease that is characterized by significant reduction in mitochondrial DNA in affected tissues, resulting in impaired mtDNA-encoded protein synthesis and energy production in the affected tissues and organs." ;
    :has_exact_synonym "mtDNA depletion syndrome"@en .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_mitochondrial_dysfunctions_syndrome rdfs:subClassOf :mitochondrial_metabolism_disease ;
    :has_definition "A mitochondrial metabolism disease that is characterized by reduced function of more than one stage of of energy production resulting from mitochondria impairment." ;
    :has_exact_synonym "fatal multiple mitochondrial dysfunction syndrome"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mitochondrial_dna_depletion_syndrome_8b rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :cachexia ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :ptosis ],
        [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :gastrointestinal_dysmotility ],
        :autosomal_recessive_disease,
        :mitochondrial_dna_depletion_syndrome ;
    :has_definition "A mitochondrial DNA depletion syndrome that is characterized by ophthalmoplegia, ptosis, gastrointestinal dysmotility, cachexia, peripheral neuropathy, and brain MRI changes, known as the MNGIE phenotype, and has_material_basis_in autosomal recessive homozygous or compound heterozygous mutation in the ribonucleotide reductase M2 B gene on chromosome 8q22." ;
    :has_exact_synonym "mitochondrial neurogastrointestinal encephalopathy syndrome, RRM2B-related"@en .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multiple_mitochondrial_dysfunctions_syndrome_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :multiple_mitochondrial_dysfunctions_syndrome ;
    :has_definition "A multiple mitochondrial dysfunctions syndrome that is characterized by hypotonia, inability to walk, poor speech, intellectual disability, and motor abnormalities, such as ataxia, dystonia, and spasticity with onset in early childhood and has_material_basis_in autosomal recessive homozygous or compound heterozygous mutation in the PMPCB gene on chromosome 7q22." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:breast_implant_associated_anaplastic_large_cell_lymphoma rdfs:subClassOf :peripheral_t_cell_lymphoma ;
    :has_definition "A periperal T-cell lymphoma characterized by development around textured-surface breast implants confined to the capsule." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vegetable_allergy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_allergic_trigger ;
            owl:someValuesFrom :vegetable_food_product ],
        :food_allergy ;
    :has_definition "A food allergy triggered by a vegetable food product." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:celery_allergy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_allergic_trigger ;
            owl:someValuesFrom :leaf_celery_food_product ],
        :vegetable_allergy ;
    :has_definition "A vegetable allergy triggered by celery (Apium graveolens)." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:arthrogryposis_multiplex_congenita_6 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :congenital_onset ],
        :arthrogryposis_multiplex_congenita ;
    :has_definition "An arthrogryposis multiplex congenita characterized by congenital joint contractures, dysmorphic facial features, distal skeletal anomalies with clenched hands and clubfeet, and edema with fetal hydrops and that has_material_basis_in homozygous or compound heterozygous mutation in the NEB gene on chromosome 2q23." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epithelial_recurrent_erosion_dystrophy rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :epithelial_and_subepithelial_dystrophy ;
    :has_definition "An epithelial and subepithelial dystrophy that is characterized by frequent painful recurrent corneal erosions, small gray anterior stromal flecks associated with larger focal gray-white disc-shaped, circular, or wreath-like lesions with central clarity." ;
    :has_exact_synonym "COL17A1",
        "ERED" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebellar_hypoplasia rdfs:subClassOf :cerebellar_disease ;
    :has_definition "A cerebellar disease that is characterized by a cerebellum that is smaller than usual or not completely developed." ;
    :has_exact_match "MESH:C562568" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cerebellar_hyplasia_atrophy_epilepsy_and_global_developmental_delay rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :intellectual_disability ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :nystagmus ],
        :syndrome ;
    :has_definition "A syndrome with a cerebellar malformation as a major feature characterized by cerebellar hypoplasia, bilateral retinal pigmentary changes, intellectual disability that can range from mild to moderate and pronounced language development delay. It presents with early developmental delay, central and peripheral non-progressive visual impairment or asymptomatic retinal changes, hypotonia, non-progressive ataxia and nystagmus." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:classic_citrullinemia rdfs:subClassOf :citrullinemia ;
    :has_definition "A citrullinemia that has_material_basis_in homozygous or compound heterozygous mutation in the ASS1 gene, which encodes argininosuccinate synthetase, on chromosome 9q34." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neonatal_onset_type_ii_citrullinemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_recessive_inheritance ],
        :autosomal_recessive_disease,
        :citrullinemia ;
    :has_definition "A citrullinemia that is characterized by confusion, restlessness, memory loss, abnormal behaviors (such as aggression, irritability, and hyperactivity), seizures and coma, caused by citrin deficiency (NICCD), and has_material_basis_in homozygous or compound heterozygous mutation in the SLC25A13 gene." ;
    :has_exact_synonym "neonatal-onset type 2 citrullinemia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adult_onset_type_ii_citrullinemia rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :existence_starts_during ;
            owl:someValuesFrom :adult_onset ],
        :citrullinemia ;
    :has_definition "A citrullinemia that has_material_basis_in homozygous or compound heterozygous mutation in the SLC25A13 gene on chromosome 7q21." ;
    :has_exact_synonym "citrin deficiency" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:csf1r_related_brain_malformation_and_osteopetrosis rdfs:subClassOf :neuroaxonal_dystrophy ;
    :has_definition "A neuroaxonal dystrophy that has_material_basis_in heterozygous mutations in CSF1R and causes adult-onset leukoencephalopathy with axonal spheroids and pigmented glia, characterized by progressive cognitive and motor impairment and seizures in the fourth to fifth decade of life." ;
    :has_exact_synonym "osteoporosis and infantile neuroaxonal dystrophy" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ocular_tuberculosis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :disease_has_location ;
            owl:someValuesFrom :eye ],
        :eye_disease,
        :tuberculosis ;
    :has_definition "A tuberculosis that is located_in some eye, has_material_basis_in Mycobacterium tuberculosis, and has_sypmtom inflamed eyes." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:vertebral_anomalies_and_variable_endocrine_and_t_cell_dysfunction rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :autosomal_dominant_disease,
        :syndrome ;
    :has_definition "A syndrome that has_material_basis_in heterozygous mutation in the TBX2 gene on chromosome 17q23 and is characterized by craniofacial dysmorphisms, cardiac anomalies, skeletal malformations, immune deficiency, endocrine abnormalities and developmental impairments." ;
    :has_exact_synonym "heterozygotes for TBX2 variants" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neurodevelopmental_disorder_with_cataracts_poor_growth_and_dysmorphic_facies rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :abnormality_of_gait ],
        [ a owl:Restriction ;
            owl:onProperty :disease_has_feature ;
            owl:someValuesFrom :cataract ],
        [ a owl:Restriction ;
            owl:onProperty :has_phenotype ;
            owl:someValuesFrom :neurodevelopmental_abnormality ],
        :syndrome ;
    :has_definition "A syndrome that is characterized by impaired intellectual development with absent language and short stature and that has_material_basis_in homozygous mutation in the INTS1 gene on chromosome 7p22." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:encephalopathy_due_to_defective_mitochondrial_and_peroxisomal_fission_1 rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :delayed_psychomotor_development ],
        :syndrome ;
    :has_definition "A syndrome that has_material_basis_in heterozygous mutation in the DNM1L gene, and is characterized by delayed psychomotor development and has_symptom hypotonia that may lead to death in childhood." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:spinal_muscular_atrophy_with_lower_extremity_predominant rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :autosomal_dominant_disease,
        :spinal_muscular_atrophy ;
    :has_definition "A spinal muscular atrophy that has_material_basis_in autosomal dominant inheritance and is characterized by muscle weakness and wasting in the lower limbs, most affecting the thigh muscles." ;
    :has_exact_synonym "spinal muscular atrophy with lower extremity predominance" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

