            owl:onProperty :has_material_basis_in ;
            owl:someValuesFrom :autosomal_dominant_inheritance ],
        [ a owl:Restriction ;
            owl:onProperty :has_symptom ;
            owl:someValuesFrom :muscle_weakness ],
        :spinal_muscular_atrophy_with_lower_extremity_predominant ;
    :has_definition "A spinal muscular atrophy with lower extremity predominance that is characterized by early childhood onset of muscle weakness and atrophy predominantly affecting the proximal and distal muscles of the lower extremity, although some patients may show upper extremity involvement and that has_material_basis_in heterozygous mutation in the BICD2 gene on chromosome 9q22." ;
    :has_exact_synonym "spinal muscular atrophy with lower extremity predominance 2A" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

