            owl:someValuesFrom :autosomal_dominant_inheritance ],
        :spinal_muscular_atrophy_with_lower_extremity_predominant ;
    :has_definition "A spinal muscular atrophy with lower extremity predominance that is characterized by decreased fetal movements and are congenital contractures consistent with arthrogryposis multiplex congenita and that has_material_basis_in heterozygous mutation in the BICD2 gene on chromosome 9q22." ;
    :has_exact_synonym "spinal muscular atrophy with lower extremity predominance 2B" .

